CREATE SCHEMA iot;
CREATE TABLE iot.cars (
	vehicle_id int4 NULL,
	time_gps int8 NULL,
	accel_speed float8 NULL,
	lightning int4 NULL,
	latitude float8 NULL,
	longitude float8 NULL,
	car_speed float8 NULL,
	brake_status int4 NULL,
	gear_position varchar(10) NULL,
	fuel_level float8 NULL,
	tire_pressure float8 NULL,
	engine_rpm int4 NULL,
	oil_surplus float8 NULL,
	battery_surplus float8 NULL,
	engine_temperature float8 NULL,
	driver_heartbeats int4 NULL,
	"timestamp" timestamp DEFAULT now() NULL
);
